import React from 'react';
import { Input, Button } from 'antd';
function Login() {
  return (
    <div style={{ width: '300px', margin: 'auto', marginTop: '100px' }}>
      <Input
        placeholder="Enter your email"
        style={{ marginBottom: '20px' }}
      />
      <Button type="primary" block>
        Sign In
      </Button>
    </div>
  );
}

export default Login;
